import '../index.scss'
import { combineReducers, applyMiddleware } from 'redux'
import { appWithRedux } from 'next-redux'

const MyApp = function({ Component, pageProps }) {
  return (
    <>
      <Component {...pageProps}/>
    </>
  )
}

export default MyApp
